import React from "react";
class Header extends React.Component {
  constructor(props) {
    super(props);
  }


  render() {
    return (<div className="header-container">
            <div className="header-banner">
              <h1>String Theory</h1>
              </div>
          </div>)
  }
}
export default Header;
